import React, { Component } from 'react';


export default class CreateMessage extends Component {

    constructor(props) {
        super(props);

        this.state = {

            msg: '',
            by: '',
            timestamp: new Date(),
            room: ''

        }
    }
    onChangeMessage(e) {
        this.setState({
            msg: e.target.value
        });
    }
    onChangeAuthor(e) {
        this.setState({
            by: e.target.value
        });
    }
    onChangetimestamp(e) {
        this.setState({
            timestamp: e.target.value
        });
    }
    onChangeRoom(e) {
        this.setState({
            room: e.target.value
        });
    }

    render() {
        return (
            <div>
                <p>You are on Create Message page</p>
            </div>
        )
    }

}
